import type Toast from "../../Toast.js";
import type { ClassMapValue } from "@ui5/webcomponents-base/dist/types.js";

function block0 (this: Toast, context: UI5Element, tags: string[], suffix: string | undefined) { return html`${ this.open ? block1.call(this, context, tags, suffix) : undefined } `;}
function block1 (this: Toast, context: UI5Element, tags: string[], suffix: string | undefined) { return html`<div class="ui5-toast-root" role="alert" tabindex="${ifDefined(this._tabindex)}"><bdi><slot></slot></bdi></div>`;}


